const newClass = {}
export default function createClassReducer(praState = newClass, action) {
  const { type, data } = action
  switch (type) {
    case 'setSchool':
      return { praState:data }
    case 'setClass':
      // console.log('1111');
      // console.log({...praState});
      // console.log(data);
      // console.log({ ...praState, ...data });
      return { ...praState, ...data }

    default:
      return praState
  }
}
